INSERT INTO `posts` VALUES (1,'	Calculates the SHA-2 family of hash functions (SHA-224, SHA-256, SHA-384, and SHA-512) (as of Hive 1.3.0). The first argument is the string or binary to be hashed. The second argument indicates the desired bit length of the result, which must have a value of 224, 256, 384, 512, or 0 (which is equivalent to 256). SHA-224 is supported starting from Java 8. If either argument is NULL or the hash length is not one of the permitted values, the return value is NULL. Example: sha2(\'ABC\', 256) = \'b5d4045c3f466fa91fe2cc6abe79232a1a57cdf104f7a26e716e0a1e2789df78\'.','2017-09-20 09:43:16',3,NULL),(2,'要想在服务器上只使用 UTC 时间，一个优雅的解决方案是，把时间单位发送给 web 浏览器，转换称当地时间，然后渲染。web 浏览器可以很好地完成这一任务，因为它能获取用户电脑中的时区和区域设置。','2017-09-20 13:45:15',4,NULL),(3,'Maecenas ut massa quis augue luctus tincidunt. Praesent lectus. Nulla ac enim.','2017-09-04 00:00:00',62,NULL),(4,'Fusce posuere felis sed lacus. Nulla ut erat id mauris vulputate elementum. Quisque id justo sit amet sapien dignissim vestibulum.','2017-09-12 00:00:00',49,NULL),(5,'Nulla tempus. In congue.','2017-09-06 00:00:00',26,NULL),(6,'Suspendisse accumsan tortor quis turpis. Proin eu mi. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Nulla dapibus dolor vel est.','2017-09-08 00:00:00',41,NULL),(7,'Vivamus vel nulla eget eros elementum pellentesque.','2017-09-19 00:00:00',11,NULL),(8,'Ut tellus. Proin eu mi.','2017-09-09 00:00:00',81,NULL),(9,'Nullam porttitor lacus at turpis. Integer ac leo. Donec diam neque, vestibulum eget, vulputate ut, ultrices vel, augue.','2017-09-15 00:00:00',34,NULL),(10,'Integer tincidunt ante vel ipsum.','2017-09-16 00:00:00',46,NULL),(11,'Nam tristique tortor eu pede. Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aliquam erat volutpat.','2017-09-12 00:00:00',61,NULL),(12,'Quisque arcu libero, rutrum ac, lobortis vel, dapibus at, diam.','2017-09-15 00:00:00',19,NULL),(13,'Curabitur convallis. Nullam varius. Aliquam augue quam, sol